import { Component } from "react";
import {Image} from "react-bootstrap";
import killerbee from '../assets/killerbee.png';
import Background from '../assets/background-2.jpg';

class HomePage extends Component {

    render() {
        return(
            <div className="h-100 m-auto mt-5 background-image">
                <h1 className="text-center">Bienvenu sur le site de KillerBee</h1>
                {/* <Image src={killerbee} fluid /> */}
            </div>
        )
    }

}


export default HomePage;
